import React from 'react'; 
import{Dropdown,DropdownButton} from 'react-bootstrap'

const handleSelect=(e)=>{
    console.log("Inside handleSelect: " + e.target.value);
  }

  const Select=(e)=>{
    console.log(e.target.value);
   
  }
 
//    <DropdownButton
//       alignRight
//       title="Dropdown right"
//       id="dropdown-menu-align-right"
//       onSelect={handleSelect}
//         ></DropdownButton>
const filter = () => {
    return(
        <>
        <div style={{ display:'flex', flexDirection:'row',}}>
            {/* //dropdown1 */}
    <Dropdown style={{marginRight:'15px'}}>
  <Dropdown.Toggle variant="info" id="dropdown-basic">
   Successful Launch
  </Dropdown.Toggle>

  <Dropdown.Menu  >
    <Dropdown.Item
    
   id="Gender" 
name="Gender" 
//value={this.state.Gender} 
   onChange ={handleSelect}>
   <option value="male" className ='margin' defaultValue={null}>Male</option>
   <option value="female" className ='margin'>Female</option>
   <option value="other" className ='margin'>Other
   
   </option>
     True</Dropdown.Item>
    <Dropdown.Item href="">False</Dropdown.Item>
   
  </Dropdown.Menu>
</Dropdown> 

   {/* //dropdown2 */}

<Dropdown style={{marginRight:'15px'}} >
<Dropdown.Toggle variant="info" id="dropdown-basic">
 Successful Landing
</Dropdown.Toggle>

<Dropdown.Menu  >
  <Dropdown.Item href="#/action-1" onChange ={handleSelect}>True</Dropdown.Item>
  <Dropdown.Item href="#/action-2" onChange ={handleSelect}>False</Dropdown.Item>
 
</Dropdown.Menu>
</Dropdown>
 
   {/* //dropdown3 */}
<Dropdown>
<Dropdown.Toggle variant="info" id="dropdown-basic">
Year
</Dropdown.Toggle>

<Dropdown.Menu onChange={handleSelect}>
  <Dropdown.Item href="#/action-1">2012</Dropdown.Item>
  <Dropdown.Item href="#/action-2">2013</Dropdown.Item>
 
</Dropdown.Menu>
</Dropdown>

<DropdownButton 
      alignRight
      title="Dropdown right"
      id="dropdown-menu-align-right"
      onChange={Select}
        >
              <Dropdown.Item eventKey="option-1">option-1</Dropdown.Item>
              <Dropdown.Item eventKey="option-2">option-2</Dropdown.Item>
              <Dropdown.Item eventKey="option-3">option 3</Dropdown.Item>
              <Dropdown.Divider />
              <Dropdown.Item eventKey="some link">some link</Dropdown.Item>
      </DropdownButton>


</div>
           <div class="form-group">
          <label  for="Gender"className ='margin' >Gender :- </label>
           <select 
            id="Gender" 
         name="Gender" 
         //value={this.state.Gender} 
            onChange ={handleSelect}>
            <option value="male" className ='margin' defaultValue={null}>Male</option>
            <option value="female" className ='margin'>Female</option>
            <option value="other" className ='margin'>Other
            
            </option>
           
          </select>
          </div> 


</>
    )

}

export default filter;
